RESPONSE=${RESPONSE1}${RESPONSE2}${RESPONSE3}

for (( N=1; N<=2500; N++ )) {

    HISTORY_RECORD_ID=${N}
    VISITOR_ID=${N}
    BOOK_NUMBER=$(( N*5+1 ))


    BOOK_PICK_DATE=$(echo "$RESPONSE"  | jq '.['$N'] .bookPickDate' | tr '/' '-' | tr -d "\"" )
    BOOK_EXPECTED_RETURN_DATE=$(date --date="${BOOK_PICK_DATE} +$(shuf -i3-20 -n1) day" +%Y-%m-%d)

    if (( ${N}<=1500 )); then
        BOOK_ACTUAL_RETURN_DATE=$(date --date="${BOOK_EXPECTED_RETURN_DATE} +$(shuf -i1-20 -n1) day" +%Y-%m-%d)
    else
        BOOK_ACTUAL_RETURN_DATE=$(date --date="${BOOK_EXPECTED_RETURN_DATE} -$(shuf -i1-5 -n1) day" +%Y-%m-%d)
    fi

    IS_FAILED_BOOK_RETURN=''
    if (( ${N}<=1500 )); then IS_FAILED_BOOK_RETURN="true"; else IS_FAILED_BOOK_RETURN="false"; fi

    DEBT="{}"     #leave empty
    FEEDBACK=$(shuf -i1-5 -n1) # from 1 to 5
    COMMENT=""

#   Book_data saving to file...
    echo "  - historyId: $HISTORY_RECORD_ID" >> $OUTPUT_FNAME
    echo "    visitorId: $VISITOR_ID" >> $OUTPUT_FNAME
    echo "    bookNumber: $BOOK_NUMBER" >> $OUTPUT_FNAME

    echo "    bookPickDate: $BOOK_PICK_DATE" >> $OUTPUT_FNAME
    echo "    bookExpectedReturnDate: $BOOK_EXPECTED_RETURN_DATE" >> $OUTPUT_FNAME
    echo "    bookActualReturnDate: $BOOK_ACTUAL_RETURN_DATE" >> $OUTPUT_FNAME

    echo "    isFailedBookReturn: $IS_FAILED_BOOK_RETURN" >> $OUTPUT_FNAME
    echo "    debt: $DEBT" >> $OUTPUT_FNAME
    echo "    feedback: $FEEDBACK" >> $OUTPUT_FNAME
    echo "    comment: $COMMENT" >> $OUTPUT_FNAME
}